import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-tile',
  template: `
  `,
  styles: [
    `
       :host {
        aspect-ratio: 1;
        width: 100%;
        height: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 50px;
        box-sizing: border-box;
      }
    `,
  ],
})
export class TileComponent {
  @Input() x: number = 5;
  @Input() y: number = 5;
}
